import React, { Component } from 'react';
import { Trans, translate } from 'react-i18next';
import logo from './logo.svg';
import './App.css';


class App extends Component {
  render() {
    const { t, i18n } = this.props;

    const changeLanguage = lng => {
      console.log('in change lang', lng)
      i18n.changeLanguage(lng);
    };

    return (
      <div className="App">
        <div className="App-header">
          <button onClick={() => changeLanguage('jp')}>de</button>
          <button onClick={() => changeLanguage('en')}>en</button>
        </div>
        <h1 className="App-title">
            { t('welcome.title', { framework: "react-i18next" }) }
        </h1>
        <Trans i18nKey='welcome.intro'>
            To get started, edit <code>src/App.js</code> and save to reload.
        </Trans>

        <Nav />
        <MobileNav />
        <Hero />
        <div className="card-container">
          <DisplayCards />    
        </div>
        <Footer />
          <div>
            <button onclick="i18next.changeLanguage('en')">
              english
            </button>
            <button onclick="i18next.changeLanguage('de')">
              german
            </button>
            <div id="output" />
          </div>
      </div>
    );
  }
}
export default translate('common')(App);
